import React from 'react';

const FormButton = ({start,onClickS,onClickR,reset}) => {
    return (
        <form>
            <button
                className="btn btn-dark m-2"
                type="button"
                name="start"
                value={start}
                onClick={onClickS}
                disabled={start}
            >
                Start
            </button>
            <button
                className={start ? "btn btn-primary m-2" : "btn btn-dark m-2"}
                type="button"
                name="reset"
                value={reset}
                onClick={onClickR}
            >
                Reset
            </button>
        </form>
    );
};

export default FormButton;
